package operator;

public class RelationOp {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int a=10;
		int b=20;
		
		
		System.out.println(a<b); //b greater
		System.out.println(a>b);//a greater
		System.out.println(a<=b); //b greater n equal
		System.out.println(a>=b);//a greater n equal
		System.out.println(a==b); //both equal
		System.out.println(a!=b);//not equal
		
		
	}

}
